# -------------------- Quiz core --------------------
def build_pool(db: List[dict], category: str, difficulty: str) -> List[dict]:
    """Strict category matching.
    - If category != 'ALL': questions MUST be from that category.
    - Difficulty filter applies inside the chosen category. If it yields 0 questions, we fall back to ALL difficulty
      *within the same category* (never to the whole DB).
    """
    if difficulty not in DIFFICULTIES:
        difficulty = "ALL"

    if category == "ALL":
        pool = list(db)
    else:
        pool = [q for q in db if q.get("category") == category]

    if not pool:
        return []

    if difficulty == "ALL":
        return pool

    filtered = [q for q in pool if q.get("difficulty") == difficulty]
    return filtered if filtered else pool

def judge_answer(q: dict, user: str) -> bool:
    qtype = q.get("type","text")
    ans = q.get("answer","")
    alts = q.get("alts") or []
    u = norm(user)
    if qtype == "mcq":
        choices = q.get("choices") or []
        if u.isdigit():
            idx = int(u) - 1
            if 0 <= idx < len(choices):
                return norm(choices[idx]) == norm(ans)
        return u == norm(ans)
    if u == norm(str(ans)):
        return True
    for a in alts:
        if u == norm(str(a)):
            return True
    return False

def ask_question(q: dict, timeout: int) -> Tuple[bool, float, bool, str]:
    print("\nΕρώτηση:", q.get("q","(missing question)"))
    qtype = q.get("type","text")
    if qtype == "mcq":
        choices = list(q.get("choices") or [])
        for i, c in enumerate(choices, start=1):
            print(f"  {i}) {c}")
        user, took, to = timed_input("Απάντηση (1-4 ή κείμενο): ", timeout)
    else:
        user, took, to = timed_input("Απάντηση: ", timeout)
    if to:
        return False, took, True, str(q.get("answer",""))
    return judge_answer(q, user), took, False, str(q.get("answer",""))

# -------------------- Γύρος types (text-only, Buzz-ish) --------------------
# All rounds take: pool, players(list of nick strings), scores(dict nick->πόντοι), cfg
def rnd_point_builder(pool, players, scores, cfg):
    per = cfg["show_questions_per_round"]
    rng = random.Random()
    for i in range(per):
        p = players[i % len(players)]
        clear()
        print("=== Χτίσιμο Πόντων ===")
        print(f"Σειρά: {p} | Σκορ: " + "  ".join([f"{x}:{scores[x]}" for x in players]))
        ok, took, to, ans = ask_question(rng.choice(pool), 0)
        if ok:
            scores[p] += 100
            print("\n✅ Correct! +100")
        else:
            print("\n❌ Wrong.", "(timeout)" if to else "")
            print("Απάντηση:", ans)
        pause()

def rnd_stop_the_clock(pool, players, scores, cfg):
    per = cfg["show_questions_per_round"]
    tlim = int(cfg["timer_seconds"])
    rng = random.Random()
    for i in range(per):
        p = players[i % len(players)]
        clear()
        print("=== Σταμάτα το Ρολόι ===")
        print(f"Χρονόμετρο: {tlim}s | Σειρά: {p} | Σκορ: " + "  ".join([f"{x}:{scores[x]}" for x in players]))
        ok, took, to, ans = ask_question(rng.choice(pool), tlim)
        if ok and not to:
            rem = max(0, tlim - int(round(took)))
            gained = rem * 30
            scores[p] += gained
            print(f"\n✅ Correct! +{gained} (time left)")
        else:
            print("\n❌ Wrong.", "(timeout)" if to else "")
            print("Απάντηση:", ans)
        pause()

def rnd_fastest_fingers(pool, players, scores, cfg):
    if len(players) == 1:
        return rnd_stop_the_clock(pool, players, scores, cfg)
    tlim = int(cfg["timer_seconds"])
    per = cfg["show_questions_per_round"]
    rng = random.Random()
    for _ in range(per):
        clear()
        print("=== Ταχύτερα Δάχτυλα (εναλλάξ) ===")
        print(f"Χρονόμετρο: {tlim}s | Σκορ: {players[0]}:{scores[players[0]]}  {players[1]}:{scores[players[1]]}")
        q = rng.choice(pool)
        print(f"\n{players[0]} απαντά πρώτος/η (then {players[1]})")
        ok1, t1, to1, ans = ask_question(q, tlim)
        print(f"\nNow {players[1]}:")
        ok2, t2, to2, _ = ask_question(q, tlim)
        if ok1 and ok2:
            if t1 < t2:
                scores[players[0]] += 300
                scores[players[1]] += 150
                print(f"\n✅ Both correct. {players[0]} faster! (+300 / +150)")
            elif t2 < t1:
                scores[players[1]] += 300
                scores[players[0]] += 150
                print(f"\n✅ Both correct. {players[1]} faster! (+300 / +150)")
            else:
                scores[players[0]] += 200
                scores[players[1]] += 200
                print("\n✅ Both correct, tie! (+200 each)")
        elif ok1 and not ok2:
            scores[players[0]] += 250
            print(f"\n✅ {players[0]} correct! (+250)")
        elif ok2 and not ok1:
            scores[players[1]] += 250
            print(f"\n✅ {players[1]} correct! (+250)")
        else:
            print("\n❌ Nobody got it right.")
            print("Απάντηση:", ans)
        pause()

def rnd_pass_the_bomb(pool, players, scores, cfg):
    rng = random.Random()
    bomb = rng.randint(20, 45)
    holder = rng.randrange(len(players))
    end = time.perf_counter() + bomb
    clear()
    print("=== Πέρασε τη Βόμβα ===")
    print(f"Η βόμβα σκάει σε περίπου {bomb} δευτερόλεπτα (πραγματικός χρόνος).")
    pause("Πατήστε ENTER για έναρξη...")
    while True:
        remaining = int(max(0, end - time.perf_counter()))
        if remaining <= 0:
            p = players[holder]
            scores[p] -= 300
            clear()
            print("💥 BOOM!")
            print(f"{p} was holding the bomb. -300")
            pause()
            return
        p = players[holder]
        clear()
        print("=== Πέρασε τη Βόμβα ===")
        print(f"Χρόνος που απομένει: ~{remaining}s | Κάτοχος: {p}")
        print("Σκορ:", "  ".join([f"{x}:{scores[x]}" for x in players]))
        ok, took, to, ans = ask_question(rng.choice(pool), min(cfg["timer_seconds"], max(3, remaining)))
        if ok and not to:
            holder = (holder + 1) % len(players)
            print("\n✅ Correct! Bomb passed.")
        else:
            print("\n❌ Wrong/timeout. Bomb stays!")
            print("Απάντηση:", ans)
        pause()

def rnd_high_stakes(pool, players, scores, cfg):
    rng = random.Random()
    per = cfg["show_questions_per_round"]
    for i in range(per):
        p = players[i % len(players)]
        clear()
        print("=== Υψηλό Ρίσκο (Γύρος) ===")
        print(f"Σειρά: {p} | Σκορ: " + "  ".join([f"{x}:{scores[x]}" for x in players]))
        cap = max(500, scores[p])
        while True:
            w = input(f"Ποντάρισμα από 0 έως {cap}: ").strip()
            if w.isdigit() and 0 <= int(w) <= cap:
                wager = int(w)
                break
        ok, took, to, ans = ask_question(rng.choice(pool), 0)
        if ok:
            scores[p] += wager
            print(f"\n✅ Correct! +{wager}")
        else:
            scores[p] -= wager
            print(f"\n❌ Wrong. -{wager}")
            print("Απάντηση:", ans)
        pause()

def rnd_point_stealer(pool, players, scores, cfg):
    rng = random.Random()
    per = cfg["show_questions_per_round"]
    for i in range(per):
        p = players[i % len(players)]
        other = players[(i+1) % len(players)] if len(players) == 2 else None
        clear()
        print("=== Κλέφτης Πόντων ===")
        print("Σκορ:", "  ".join([f"{x}:{scores[x]}" for x in players]))
        ok, took, to, ans = ask_question(rng.choice(pool), 0)
        if ok:
            gain = 150
            if other:
                steal = min(gain, max(0, scores[other]))
                scores[other] -= steal
                scores[p] += steal
                print(f"\n✅ Correct! Stole {steal} from {other}.")
            else:
                scores[p] += gain
                print("\n✅ Correct! +150")
        else:
            print("\n❌ Wrong.")
            print("Απάντηση:", ans)
        pause()

def rnd_over_the_edge(pool, players, scores, cfg):
    rng = random.Random()
    lives = {p: cfg.get("survival_lives", 3) for p in players}
    alive = players[:]
    turn = 0
    while len(alive) > 1:
        p = alive[turn % len(alive)]
        clear()
        print("=== Στο Χείλος ===")
        print("Ζωές:", "  ".join([f"{x}:{lives[x]}" for x in alive]))
        print("Σκορ:", "  ".join([f"{x}:{scores[x]}" for x in players]))
        ok, took, to, ans = ask_question(rng.choice(pool), 0)
        if ok:
            scores[p] += 100
            print("\n✅ Correct! +100")
        else:
            lives[p] -= 1
            print("\n❌ Wrong. -1 life.")
            print("Απάντηση:", ans)
            if lives[p] <= 0:
                print(f"{p} βγήκε εκτός!")
                alive = [x for x in alive if x != p]
        pause()
        turn += 1
    winner = alive[0]
    scores[winner] += 400
    clear()
    print("=== Στο Χείλος ===")
    print(f"Νικητής: {winner} (+400 μπόνους)")
    pause()

# NEW: Boiling Point (first to target correct)
def rnd_boiling_point(pool, players, scores, cfg):
    rng = random.Random()
    target = int(cfg.get("boiling_target", 5))
    got = {p: 0 for p in players}
    turn = 0
    while True:
        p = players[turn % len(players)]
        clear()
        print("=== Σημείο Βρασμού ===")
        print("Πρόοδος:", "  ".join([f"{x}:{got[x]}/{target}" for x in players]))
        print("Σκορ:", "  ".join([f"{x}:{scores[x]}" for x in players]))
        ok, took, to, ans = ask_question(rng.choice(pool), 0)
        if ok:
            got[p] += 1
            scores[p] += 120
            print("\n✅ Correct! +120")
            if got[p] >= target:
                scores[p] += 500
                print(f"\n🔥 {p} έφτασε {target} σωστές απαντήσεις! +500 μπόνους")
                pause()
                return
        else:
            print("\n❌ Wrong.")
            print("Απάντηση:", ans)
        pause()
        turn += 1

# NEW: On the Spot (opponent offers πόντοι for you να απαντήσει)
def rnd_on_the_spot(pool, players, scores, cfg):
    if len(players) < 2:
        return rnd_point_builder(pool, players, scores, cfg)
    rng = random.Random()
    per = cfg["show_questions_per_round"]
    tlim = int(cfg["timer_seconds"])
    for i in range(per):
        p = players[i % 2]
        o = players[(i+1) % 2]
        clear()
        print("=== Επί Τόπου ===")
        print("Σκορ:", f"{players[0]}:{scores[players[0]]}  {players[1]}:{scores[players[1]]}")
        max_offer = max(200, min(1000, scores[o] + 200))
        while True:
            offer_s = input(f"{o}, offer πόντοι for {p} να απαντήσει (0-{max_offer}): ").strip()
            if offer_s.isdigit() and 0 <= int(offer_s) <= max_offer:
                offer = int(offer_s); break
        accept = is_yes(input(f"{p}, δέχεσαι για {offer} πόντοι? (ν/ο): "))
        if not accept:
            print("\nΔεν έγινε πρόκληση. Συνεχίζουμε.")
            pause()
            continue
        ok, took, to, ans = ask_question(rng.choice(pool), tlim)
        if ok and not to:
            scores[p] += offer
            print(f"\n✅ Correct! {p} gains {offer}.")
        else:
            scores[o] += offer
            print(f"\n❌ Wrong/timeout. {o} gains {offer}.")
            print("Απάντηση:", ans)
        pause()

