# -------------------- Modes --------------------
def finalize_game(mode: str, difficulty: str, profiles: dict, hs: dict, players: List[dict], scores: Dict[str,int], meta: dict, save: bool=True) -> None:
    clear()
    print("=== ΤΕΛΟΣ ΠΑΙΧΝΙΔΙΟΥ ===\n")
    for p in players:
        nick = p.get("nickname", p.get("display_name","Παίκτης"))
        print(f"{nick}: {scores.get(nick,0)} πόντοι")
    if len(players) == 2:
        n1 = players[0].get("nickname", players[0].get("display_name","P1"))
        n2 = players[1].get("nickname", players[1].get("display_name","P2"))
        if scores.get(n1,0) > scores.get(n2,0):
            print(f"\nΝικητής: {n1}")
        elif scores.get(n2,0) > scores.get(n1,0):
            print(f"\nΝικητής: {n2}")
        else:
            print("\nIt's a tie!")

    mode_key = f"{mode} [{difficulty}]" if difficulty != "ALL" else mode

    if save:
        add_record(hs, mode_key, [p.get("nickname", p.get("display_name","Παίκτης")) for p in players], scores, meta)
        for p in players:
            nick = p.get("nickname", p.get("display_name","Παίκτης"))
            update_leaderboard(hs, mode_key, nick, scores.get(nick,0))
            key = p.get("display_name", nick)
            prof = profiles["players"].get(key)
            if isinstance(prof, dict):
                prof["games_played"] = int(prof.get("games_played",0)) + 1
                prof["total_πόντοι"] = int(prof.get("total_πόντοι",0)) + int(scores.get(nick,0))
                best = prof.get("best_scores", {})
                best[mode_key] = max(int(best.get(mode_key, 0)), int(scores.get(nick,0)))
                prof["best_scores"] = best
        save_json(HIGHSCORES_PATH, hs)
        save_json(PROFILES_PATH, profiles)

    print("\nΑποθηκεύτηκε." if save else "\nΛειτουργία εξάσκησης (δεν αποθηκεύεται).")
    pause()

def mode_buzz_choice(db: List[dict], cfg: dict, profiles: dict, hs: dict, present_categories) -> None:
    difficulty = choose_difficulty()
    p1 = choose_player(profiles, "Παίκτης 1")
    p2 = None
    if cfg["max_players"] >= 2 and input("Προσθήκη Παίκτη 2; (ν/ο): ").strip().lower().startswith(("ν","y")):
        p2 = choose_player(profiles, "Παίκτης 2")
    players = [p1] + ([p2] if p2 else [])
    nicks = [p.get("nickname", p.get("display_name","Παίκτης")) for p in players]
    scores = {n: 0 for n in nicks}
    rng = random.Random()

    rounds = int(cfg["show_rounds"])
    for r in range(1, rounds + 1):
        # Επιλέγουμε κατηγορία μόνο από αυτές που υπάρχουν στη βάση, ώστε να μη «σπάει» η δεξαμενή.
        cat = rng.choice(present_categories) if present_categories else rng.choice(CATEGORIES)
        pool = build_pool(db, cat, difficulty)
        tries = 0
        while not pool and tries < 10:
            cat = rng.choice(present_categories) if present_categories else rng.choice(CATEGORIES)
            pool = build_pool(db, cat, difficulty)
            tries += 1
        if not pool:
            cat = "ALL"
            pool = build_pool(db, cat, difficulty)

        rname, rfn = rng.choice(ROUND_TYPES)
        clear()
        print(f"=== ΕΠΙΛΟΓΗ BUZZ ===\nΓύρος {r}/{rounds} | {rname} | Κατηγορία: {cat} | Δυσκολία: {difficulty}\n")
        pause("Πατήστε ENTER για έναρξη...")
        rfn(pool, nicks, scores, cfg)

    finalize_game("Επιλογή BUZZ", difficulty, profiles, hs, players, scores, {"rounds": rounds}, save=True)

